module.exports = songs.map(song => {
  const notesStringArray = song.tracks.map(track => {
    const sortNotes = (noteArray, note) => {
      const lastNote = noteArray[noteArray.length - 1]
      if (note.time > lastNote.time) {
        noteArray.push(note)
      } else if ((note.time === lastNote.time) && (note.midi > lastNote.midi)) { // higher notes are generally the tune
        noteArray[noteArray.length - 1] = note
      }
      return noteArray
    }
    const removeNoteNumber = (note) => note.name.slice(0, -1)

    return track.notes
      .reduce(sortNotes, [{name: '', time: -1}]) // Hacky first note 
      .map(removeNoteNumber)
      .join(' ')
  })

  return {
    name: song.header.name,
    notesStringArray: notesStringArray,
  }
})
